import Vue from 'vue';
import VueRouter from 'vue-router';
import HomePage from '@/pages/HomePage';
import MyCompoundsPage from '@/pages/MyCompoundsPage';
import DataExplorerPage from '@/pages/DataExplorerPage';
import DoseResponse from '@/views/DoseResponse.vue';
import LineageEffect from '@/views/LineageEffect.vue';
import MutationEffect from '@/views/MutationEffect.vue';
import CorrelationAnalysis from '@/views/CorrelationAnalysis.vue';
import MultivariateAnalysis from '@/views/MultivariateAnalysis.vue';
import ScreenInfoPage from '@/pages/ScreenInfoPage';

Vue.use(VueRouter);



const router = new VueRouter({
    base: process.env.BASE_URL,
    routes: [
        {
            path: '/',
            name: 'HomePage',
            component: HomePage
        },
        {
            path: '/my-compounds',
            name: 'MyCompoundsPage',
            component: MyCompoundsPage
        },
        {
            path: '/data-explorer',
            name: 'DataExplorerPage',
            component: DataExplorerPage,
            children: [
                {
                    path: '/data-explorer/dose-response',
                    component: DoseResponse
                },
                {
                    path: '/data-explorer/lineage-effect',
                    component: LineageEffect
                },
                {
                    path: '/data-explorer/mutation-effect',
                    component: MutationEffect
                },
                {
                    path: '/data-explorer/correlation-analysis',
                    component: CorrelationAnalysis
                },
                {
                    path: '/data-explorer/multivariate-analysis',
                    component: MultivariateAnalysis
                }
            ]
        },
        {
            path: '/screen-info',
            name: 'ScreenInfoPage',
            component: ScreenInfoPage
        }
    ]
});



export default router
